o each other's faces. It's a subculture of honour, pride and violence.\\n\\nAs the UK prepares to play host to the first US vs UK bare knuckle title fight in 150 years -- the biggest event the scene has known since it went underground in the 19th Century -- Clive tries to find out if violence is a cause or effect for these angry young men.\\n\\nCheck out more \\\"Rule Britannia\\\" here: http:\/\/bit.ly\/1tjfsIE\\n\\nSubscribe to VICE here! http:\/\/bit.ly\/Subscribe-to-VICE\\nCheck out our full video catalog: http:\/\/bit.ly\/VICE-Videos\\nVideos, daily editorial and more: http:\/\/vice.com\\nLike VICE on Facebook: http:\/\/fb.com\/vice\\nFollow VICE on Twitter: http:\/\/twitter.com\/vice\\nRead our tumblr: http:\/\/vicemag.tumblr.com\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/a9UZBg1pMS4\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLDdxhL3J9I2Djx5Er6Zu5gLcgS06w\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/a9UZBg1pMS4\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLDqe5TEZ5eQawGJy3RYzRMVFYAbUg\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/a9UZBg1pMS4\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLAt9WkLAVOrhK2e-6FHAK9r0otiUw\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/a9UZBg1pMS4\/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLCdYhzaNJJsnhVUMPILS5pTTHaSHA\",\"width\":336,\"height\":188},{\"url\":\"https:\/\/i.ytimg.com\/vi\/a9UZBg1pMS4\/maxresdefault.jpg\",\"width\":1920,\"height\":1080}]},\"averageRating\":4.7696767,\"allowRatings\":true,\"viewCount\":\"13316407\",\"author\":\"VICE\",\"isPrivate\":false,\"isUnpluggedCorpus\":false,\"isLiveContent\":false},\"annotations\":[{\"playerAnnotationsExpandedRenderer\":{\"featuredChannel\":{\"startTimeMs\":\"0\",\"endTimeMs\":\"16
